import React, {Component} from 'react';
import './App.css';
import TextField from '@material-ui/core/TextField';


class App extends Component {
  constructor() {
    super()
    this.state = {
      pokeList:[],
      name: '',
      url: ''
    }
    this.getChamp = this.getChamp.bind(this);
  }

  componentDidMount(){
    this.getChamp()
  }

  getChamp() {
    fetch('https://pokeapi.co/api/v2/type/10/')
    .then(response => response.json())
    .then(poke => {

      let url = poke.pokemon[0].pokemon.url
      console.log(url)
      let num = url.substring(34, url.lastIndexOf("/"));
      console.log(num);
      this.setState({
        name: poke.pokemon[0].pokemon.name,
        number: num
      })
    })
  .catch(error => console.log('Champion not found!', error))
}
